import React, { useState } from 'react';

const Navbar = () => {
    const[url, setUrl] = useState("http://localhost:80");
    return (
        <nav className="navbar">


            <nav className="links">

                <h1>Links:</h1>
                <div className="links">
                    <div className="link">
                        <h1><li><a href ="#" onClick={() => setUrl("http://localhost:80")} >Apache2 Server on localhost:80</a></li></h1>
                    </div>
                    <div className="link">        
                        <h1><li><a href ="#" onClick={() => setUrl("http://dnsleaktest.com") }>DNS Leak Test</a></li></h1>
                        console.log({url});
                    </div>


                </div>

            </nav>
        </nav>


    );



}

export default Navbar;
